  }

  const timespanValue = () => {
    return(
      <div className='timespan' onClick={timespanClick}>
        7:00 - 9:00
      <img src={screw} alt = ""></img>
      </div>
    )
  }


  return (
    <div className='scheduleblock'>
      
      <div className='activities'>
        
      </div>
    </div>
  )
}
